import React from "react";
import { useNavigate } from "react-router-dom";


const Home = () => {

    const navigate = useNavigate();

    const handleClick = () => {
        const LinkTo = '/easy';
        navigate(LinkTo);

    }

    return (
        <>
        <div className="home">
           <h2>pocetak</h2>
           <div className="button" 
           onClick={handleClick()}>easy</div>
            </div></>
    )

}
export default Home;
